export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},Ldedi9phrX:{data:{id:2513,attributes:{imdbId:"tt0058633",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BY2Q5MGI2YmItZjdiMS00ZDY1LWJlYjAtYjQ0Y2VjNzEzZjJlXkEyXkFqcGdeQXVyMTE2NzA0Ng@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.8\u002F10"}],item_lang:{data:{id:3176,attributes:{title:e,plot:"Newly arrived settlers are attacked by local ranch owner Ben Blazer and his men. Kent Taggart sees his parents killed by Blazer's son, whom he tracks home. Taggart kills the boy in front of Blazer, himself dying of a wound, who then puts a price of $5,000 on Taggart's head, an offer enthusiastically taken up by ruthless killer Jason. Taggart has no option but to head out into hostile Apache country followed by Jason and other no-goods.",slug:"taggart"}}},books:{data:[{id:12093,attributes:{title:e,description:"These stories represent Louis L'Amour at his best--stirring adventure tales of the ageless Old West, as tough and gritty as the men who tames it. Each story is personally selected, with an introduction and special historical notes, by the author.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=TpQydq6PiUkC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"1998-01-01",publisher:i,subtitle:i}},{id:12094,attributes:{title:j,description:k,thumbnail:l,authors:[a],firstBook:c,published:m,publisher:d,subtitle:f}},{id:12095,attributes:{title:j,description:k,thumbnail:l,authors:[a],firstBook:c,published:m,publisher:d,subtitle:f}},{id:12096,attributes:{title:e,description:"Adam Stark had found gold. In the confusion of the mesas and canyons near Rockinstraw Mountain, Stark, his wife, Consuelo, and his sister, Miriam, were quietly working a rich vein while keeping their presence a secret from raiding Apaches. Worried that his wife might leave him, Stark wanted to make enough money to take her to San Francisco, where she could enjoy the style of life she craved. But when Taggart, a stranger on the run from a vicious bounty hunter, enters their camp, tensions soon mount. Consuelo, against all good judgment, cannot resist testing Taggart. Is he the man who can make her happy? Will he give her the life her husband cannot? With thousands of dollars of gold in his packsadles, the Apaches are now no longer Adam Stark’s only threat.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=p53VTjdZvuwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2003-12-02",publisher:d,subtitle:f}},{id:12097,attributes:{title:"The Collected Short Stories of Louis L'Amour, Volume 1",description:"With more than 120 titles still in print, Louis L'Amour is recognized the world over as one of the most prolific and popular American authors in history. Though he met with phenomenal success in every genre he tried, the form that put him on the map was the short story. Now this great writer—The Wall Street Journal recently compared with Jack London and Robert Louis Stevenson—will receive his due as a great storyteller. This volume kicks off a series that will, when complete, anthologize all of L'Amour’s short fiction, volume by handsome volume. Here, in Volume One, is a treasure-trove of 35 frontier tales for his millions of fans and for those who have yet to discover L'Amour’s thrilling prose—and his vital role in capturing the spirit of the Old West for generations to come.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Xc71BvEPrywC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2006-03-28",publisher:d,subtitle:"Frontier Stories"}}]}}},meta:{}}},prerenderedAt:1681703458792}}("Louis L'Amour","movie",null,"Bantam","Taggart","A Novel","series",1,"","Taggart (Louis L'Amour's Lost Treasures)","As part of the Louis L’Amour’s Lost Treasures series, this edition contains exclusive bonus materials! Adam Stark had found gold. In the confusion of the mesas and canyons near Rockinstraw Mountain, Stark, his wife, Consuelo, and his sister, Miriam, were quietly working a rich vein while keeping their presence a secret from raiding Apaches. Worried that his wife might leave him, Stark wanted to make enough money to take her to San Francisco, where she could enjoy the style of life she craved. But when Taggart, a stranger on the run from a vicious bounty hunter, enters their camp, tensions soon mount. Consuelo, against all good judgment, cannot resist testing Taggart. Is he the man who can make her happy? Will he give her the life her husband cannot? With thousands of dollars of gold in his packsadles, the Apaches are now no longer Adam Stark’s only threat. Louis L’Amour’s Lost Treasures is a project created to release some of the author’s more unconventional manuscripts from the family archives. In Louis L’Amour’s Lost Treasures: Volume 1 and Volume 2, Beau L’Amour takes the reader on a guided tour through many of the finished and unfinished short stories, novels, and treatments that his father was never able to publish during his lifetime. L’Amour’s never-before-seen first novel, No Traveller Returns, faithfully completed for this program, is a voyage into danger and violence on the high seas. Additionally, many beloved classics will be rereleased with an exclusive Lost Treasures postscript featuring previously unpublished material, including outlines, plot notes, and alternate drafts. These postscripts tell the story behind the stories that millions of readers have come to know and cherish.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gfE3EAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2021-07-27"))